const styles = {
    backgroundColor: "#060809",
    minHeight: "100vh",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    fontSize: "calc(10px + 2vmin)",
    color: "white",
}

const NGClogo = {

    /* identical to box height */

    // font-family: Retroica;
    fontStyle: "normal",
    fontWeight: "bold",
    fontSize: "144px",
    lineHeight: "144px",

    display: "flex",
    alignItems: "center",
    textAlign: "center",
    letterSpacing: "-0.2em",

    color: "#FF9601",
}

const Home = () => {
    return (
        <div style={styles}>
            <h1 style={NGClogo}>NG<span style={{color: "white"}}>C</span></h1>
            <h3 style={{color: "#FF9601"}}>NEAR <span style={{ color: "#fff" }}>GANG COUTURE</span></h3>
        </div>
    )
}

export default Home
